Die mit Zorobabel kamen, sind: Josue, Nehemias, Azarias, Raamias, Nahamani, Mardochäus, Belsam, Mespharath, Begoai, Nahum, Baana. Die Zahl der Männer aus dem Volke Israel:
Die Söhne Pharos: zweitausendeinhundertzweiundsiebzig;
Die Söhne Saphatias: dreihundertzweiundsiebzig;
die Söhne Areas: sechshundertzweiundfünfzig;
die Söhne Phahathmoabs von den Söhnen Josues und Joabs; zweitausendachthundertundachtzehn;
die Söhne Älams: tausendzweihundertvierundfünfzig;
die Söhne Zethuas: achthundertfünfundvierzig;
die Söhne Zachais: siebenhundertundsechzig;
die Söhne Bannuis: sechshundertachtundvierzig;
die Söhne Bebais: sechshundertachtundzwanzig;
die Söhne Azgads: zweitausenddreihundertzweiundzwanzig;
die Söhne Adonikams: sechshundertsiebenundsechzig;
die Söhne Beguais: zweitausendsiebenundsechzig;
die Söhne Adins: sechshundertfünfundfünfzig;
die Söhne Aters, des Sohnes Hezekias': achtundneunzig;
die Söhne Hasems: dreihundertachtundzwanzig;
die Söhne Besais: dreihundertvierundzwanzig;
die Söhne Harephs: hundertundzwölf;
die Söhne von Gabaon: fünfundneunzig;
die Söhne von Bethlehem und Netupha: hundertachtundachtzig;
die Männer von Anathoth: hundertachtundzwanzig;
die Männer von Bethazmoth: zweiundvierzig;
die Männer von Kariathiarim, Kephira und Beroth: siebenhundertdreiundvierzig;
die Männer von Rama und Geba: sechshunderteinundzwanzig;
die Männer von Machmas: hundertzweiundzwanzig;
die Männer von Bethel und Hai: hundertdreiundzwanzig;
die Männer vom andern Nebo: zweiundfünfzig;
die Männer von dem andern Älam: tausendzweihundertvierundfünfzig;
die Söhne Harems: dreihundertundzwanzig;
die Söhne von Jericho: dreihundertfünfundvierzig;
die Söhne von Lod, Hadid und Ono: siebenhunderteinundzwanzig;
die Söhne von Senaa: dreitausendneunhundertunddreißig.
